import React from "react";
import profileImage from "../../assets/cover/paul-photo.jpg";

function Home() {
  return (
    <section class="flex-parent-element">
      <div class="flex-child-element magenta">Flex Column 1</div>
      <div class="flex-child-element green">Flex Column 2</div>
    </section>
  );
}

export default Home;
